Teaser:
Exécutez vos programmes C/C++ dans ChATGPT à l'aide de cette invite. Il s'agit d'une invite très puissante pour exécuter toutes sortes de langages de codage directement dans votre navigateur Web à l'aide de Chatgpt.

 Tapez simplement votre code C ou C++ que vous souhaitez exécuter dans l'invite et Chat-GPT vous donnera la sortie de ce programme en réponse.

 Ceci est utile si vous n'avez pas de compilateur installé sur votre PC et que vous souhaitez tester du code maintenant, vous pouvez le faire par simple invite.

 Exemple de code C++.
 #include <Istream>

